import React from 'react';
export class Users extends React.Component {

users=[
  {id:1,
    bio:'Love busket',
    name:'Bil',
    image:'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fvjoy.cc%2Fwp-content%2Fuploads%2F2020%2F10%2F1523649151_1.jpg&f=1&nofb=1&ipt=486a127f4869a91a8c9d57b64aef0e7c505330d48573e4b50bcd67af15625729&ipo=images'
  },
  {id:2,
    bio:'good singer',
    name:'Sara'
  },
  {id:3,
    bio:'Fast as wind',
    name:'Jack'
  },
  {id:.4,
    bio:'Bodybuilder',
    name:'Lilo'
  }
  
]


  render() {

    return (
      <div className="user-list">
        {
          this.users.map((el)=>(
            <div className="user-card" key={el.name}>
              <h2>
                {el.name}
              </h2>
              <p>{el.bio}</p>
            </div>
          ))
        }
      </div>
    );
  }
}
export default Users;
